import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import HomePage from './Pages/HomePage';


function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact component={HomePage} ></Route>
          <Route path="/about" exact component={AboutPa} ></Route>
          <Route path="/skills" exact component={HomePage} ></Route>
          <Route path="/work" exact component={HomePage} ></Route>
          <Route path="/contact" exact component={HomePage} ></Route>

        </Switch>
      </Router>
     </div>
  );
}

export default App;
